/**
 * Debouncing
 *             ,
 *          .
 *   :
 * -      ,       ,
 *      .
 * -    ,      ,    ,
 *      ,     .
 * @param {function} func callback 
 * @param {number} ms  
 * @returns {function}
 */
function debounce(func, ms) {

    var timer = null;

    return function () {
        var _this = this;

        for (var _len = arguments.length, args = Array(_len), _key = 0; _key < _len; _key++) {
            args[_key] = arguments[_key];
        }

        var onComplete = function onComplete() {
            func.apply(_this, args);
            timer = null;
        };

        if (timer) {
            clearTimeout(timer);
        }

        timer = setTimeout(onComplete, ms);
    };
}

/**
 * Throttling
 *                ,
 *           .
 * ..     .
 * @param {function} func callback 
 * @param {number} ms  
 * @returns {function}
 */
function throttle(func, ms) {

    var isThrottled = false,
        savedArgs,
        savedThis;

    function wrapper() {

        if (isThrottled) {
            savedArgs = arguments;
            savedThis = this;
            return;
        }

        func.apply(this, arguments);

        isThrottled = true;

        setTimeout(function() {
            isThrottled = false;
            if (savedArgs) {
                wrapper.apply(savedThis, savedArgs);
                savedArgs = savedThis = null;
            }
        }, ms);
    }

    return wrapper;
}

/**
 *     localStorage
 *
 * @type {{state, remove, exist}}
 */
var localStorageComponent = (function(){

    // PRIVATE =========================================================================================================

    var setItem = function ( name, value ) {
        if ( typeof value === 'object' ) {
            localStorage.setItem(name, JSON.stringify(value));
        } else {
            localStorage.setItem(name, value);
        }
    };

    var getItem = function (name) {
        var value = localStorage.getItem(name);
        var result;
        try {
            result = JSON.parse(value);
        } catch (e) {
            return value;
        }
        return result;
    };

    var removeItem = function (name) {
        localStorage.removeItem(name);
    };

    var existItem = function (name) {
        var value = getItem(name);
        var result = false;
        if( value !== null && typeof value !== 'undefined'){
            result = true;
        }
        return result;
    };

    // PUBLIC ==========================================================================================================

    return Object.freeze({
        /**
         *      LocalStorage
         * @param {string} name  
         * @param {string|number|json|array|*} value  ,   -   
         */
        state: function(name, value){
            if(typeof value !== "undefined"){
                setItem(name, value);
            }
            else {
                return getItem(name);
            }
        },
        /**
         *    LocalStorage   
         * @param {string} name
         */
        remove: function(name){
            removeItem(name);
        },
        /**
         *     LocalStorage   
         * @param {string} name
         */
        exist: function(name){
            return existItem(name);
        }
    });
}());

/**
 *     
 * @method {{ init, current, direction, enable, disable}}
 */
var scrollComponent = (function(){

    var self = {
        elsTransform: null,
        isTransform: true,
        current: 0,
        previous: 0,
        backup: 0
    };

    // PRIVATE =========================================================================================================

    var addTransformElements = function(selector){
        self.elsTransform = document.querySelectorAll(selector);
    }

    var scrollCheck = function () {
        self.previous = self.current;
        self.current = document.documentElement.scrollTop || window.pageYOffset || window.scrollY;
    };

    /* scroll to */
    var scrollMoveTo = function (position) {
        window.scrollTo( 0, position );
    };

    /* save scroll position */
    var scrollSave = function () {
        self.backup = document.documentElement.scrollTop || window.pageYOffset || window.scrollY;
    };

    /* scroll enable */
    var scrollEnable = function ( ) {
        if ( self.isTransform = true ) {
            self.elsTransform.forEach(function(item){
                item.style.transform = 'none'; 
            });
        }
        document.body.style.overflowY = '';
        document.body.style.position = '';
    };

    /* scroll disable */
    var scrollDisable = function ( useTransform ) {
        ( useTransform === false ) ? self.isTransform = false : self.isTransform = true ; 
        if ( self.isTransform ) {
            self.elsTransform.forEach(function(item){
                item.style.transform = 'translateY(' + -self.backup + 'px)';
            });
        }
        document.body.style.overflowY = 'hidden';
        document.body.style.position = 'fixed';
    };

    // INIT ============================================================================================================

    scrollCheck();
    window.addEventListener('scroll', function() {
        scrollCheck();
    });


    // PUBLIC ==========================================================================================================

    return Object.freeze({
        /**
         *    ,    
         * @method
         * @param {string} selector 
         */
        init: function(selector){
            if( typeof selector !== 'undefined') addTransformElements(selector);
        },
        /**
         *     
         * @param {number} value   
         * @returns {number}  
         */
        current: function(value){
            if(typeof value !== "undefined"){
                scrollMoveTo(value);
                scrollCheck();
            }
            else {
                scrollCheck();
                return self.current;
            }
        },
        /**
         *   
         * @returns {*} 'down'|'up'
         */
        direction: function(){
            return ( self.current >= self.previous ) ? 'down' : 'up';
        },
        /**
         *  
         */
        enable: function(){
            scrollEnable();
            scrollMoveTo(self.backup);
        },
        /**
         *  
         * @param {bolean} useTransform   
         */
        disable: function(useTransform){
            scrollSave();
            scrollDisable(useTransform);
        }
    });
}());

